import React from 'react';
import { history } from '../../history'

export default class ManageContainer extends React.Component{

    componentDidMount() {
        if(localStorage.token){
          fetch('http://localhost:3000/get_user_by_token', {
              headers: {
                  Authorization: `Bearer ${localStorage.token}`
              }
          })
            .then(res => res.json())
            .then(profile => {
              if (!profile.failed) {
                this.setState({
                  loggedInUser: profile
                });
              }
            })
        }else{
          history.push("/login")
        }
    }

    render(){
        return(
            <div id="ManageContainer" style={{maxWidth: "450px"}}>
                <div className="ui divided items" style={{flex: 1}}>
                    <div className="item">
                        <div className="image">
                            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/94/Whataburger_logo.svg/1200px-Whataburger_logo.svg.png"></img>
                        </div>
                        <div className="content">
                            <a className="header">12 Years a Slave</a>
                            <div className="meta">
                                <span className="cinema" style={{margin: "50px"}}>Union Square 14</span>
                            </div>
                            <div className="description" style={{margin: "15px"}}>
                                <p>llolool</p>
                                <p>Manager: </p>
                            </div>
                            <div className="extra ui">
                                <button class="ui primary button">
                                    Save
                                </button>
                                <button class="ui red button">
                                    Save
                                </button>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
